import React, { useEffect, useState } from 'react'
import { Button } from 'reactstrap';
import Nutri from './wishList/Nutri';
import axios from 'axios'

const WishList = ({userId}) => {

  const [wishList, setWishList] = useState([])

  const [eyeList, setEyeList] = useState([])

  useEffect(()=>{
    axios.get(`http://localhost:8085/haru/wishlist/${userId}`)
    .then((res)=>{
      console.log('찜리스트 통신 성공', res.data);
      setWishList(res.data)
    })
    .catch((e)=>{
      console.log('error', e);
    })
  },[])

  let temp = []
  useEffect(()=>{
    setEyeList(wishList.filter((item)=>(item.nutri_name == '오메가3')))
    
  },[wishList])


  useEffect(()=>{
    console.log('eye : ', eyeList);
  },[eyeList])

  return (
    <div>
      <h3>찜리스트</h3>
      <div>
        <Nutri wishList={wishList}/>
        <Button color="success" onClick={()=>{window.location.href="/haru/wishlist/samenutri"}}>동일 영양성분군 비교하기</Button>
        <Button color="success" onClick={()=>{window.location.href="/haru/wishlist/othernutri"}}>영양성분 조합 확인하기</Button>
      </div>
    </div>
  )
}

export default WishList
